import React from "react";
import mascote3 from "../img/macaco-caolho-mascote3.png";

import WOW from "wow.js";

class Header extends React.Component {
  componentDidMount() {
    const wow = WOW();
    wow.init();
  }
  render() {
    return (
      <div>
        <div className="welcome">
          <h1 className="wow fadeIn" id="welcome">
            Macaco Caolho
          </h1>
          <h1 id="rock">Rock n' Drinks</h1>
        </div>

        <div class="container-sm" id="imgMacaco">
          <img src={mascote3} />
        </div>
      </div>
    );
  }
}
export default Header;
